// Efecto navBar Sticky
!(function (e, n, t) {
	console.log('init');
	var o = {
		init: function (t) {
			o.navbarChange();
		},

		navbarChange: function () {
			e(n).scroll(function () {
				var t = e(n).scrollTop();
				return (
					150 < t
						? e('body').addClass('not-on-top')
						: e('body').removeClass('not-on-top'),
					!1
				);
			});
		},
	};
	e(t).ready(function () {
		o.init(e);
	});
})(window.jQuery, window, document);
// FIN Efecto navBar Sticky

